def generate_clean_high_rain_percentage(size, dry_percentage, scale=5.0):
    """
    Generate a synthetic rain rate time series with high rain coverage and sparse dry gaps,
    aligned on 15-minute (90-sample) intervals.

    Parameters:
        size (int): Total number of time steps
        dry_percentage (float): Fraction of dry samples (0.0 to 1.0)
        scale (float): Scale parameter for exponential rain distribution (mean rain rate in mm/h)

    Returns:
        np.ndarray: Array of rain rate values (float32), with dry segments (value = 0)
    """
    assert 0.0 <= dry_percentage < 1.0, "dry_percentage must be between 0.0 and 1.0"
    assert 'dry_event_lengths_in_samples' in globals(), "dry_event_lengths_in_samples must be defined globally"

    rng = np.random.default_rng()

    # Step 1: Full rain initialization
    rain_rate = rng.exponential(scale=scale, size=size).astype(np.float32)
    rain_rate = np.clip(rain_rate, 0, 70)

    # Step 2: Calculate how many samples should be dry
    target_dry_samples = int(size * dry_percentage)
    current_dry_samples = 0

    # Step 3: Inject dry events aligned to 15-min intervals
    while current_dry_samples + 180 < target_dry_samples:
        event_len = int(rng.choice(dry_event_lengths_in_samples))
        event_len = (event_len // 90) * 90  # round down to nearest multiple of 90
        if event_len < 90:
            continue  # skip if too short

        # Clip to fit remaining dry budget (rounded down to nearest multiple of 90)
        remaining = target_dry_samples - current_dry_samples
        if event_len > remaining:
            event_len = (remaining // 90) * 90
            if event_len < 90:
                break

        # Start index must be a multiple of 90
        valid_starts = np.arange(0, size - event_len + 1, 90)
        start = rng.choice(valid_starts)

        # Ensure no overlap with previous dry zones
        if np.any(rain_rate[start:start + event_len] == 0.0):
            continue

        # Apply dry event
        rain_rate[start:start + event_len] = 0.0
        current_dry_samples += event_len

    return rain_rate
