def generate_clean_synthetic_rain_rate_ema(size,
                                           rain_percentage=0.087,
                                           scale=5.0,
                                           alpha=0.15):
    """
    Generate a synthetic rain rate time series with both dry and wet periods.
    Rain events start and end on 15-minute (90-sample) boundaries, using
    valid rain lengths from OpenMRG-derived distribution.
    Applies EMA smoothing within each rain event.

    Parameters:
    - size: int, total number of time steps.
    - rain_percentage: float (0 to 1), proportion of time steps that should contain rain.
    - scale: float, the scale parameter of the exponential distribution ( = 1/scale).
    - alpha: float, EMA smoothing factor (between 0 and 1).

    Returns:
    - rain_rate: np.ndarray of shape (size,), with zeros for dry periods and
                 smoothed exponential rain values for wet periods.
    """
    import numpy as np

    rng = np.random.default_rng()
    rain_rate = np.zeros(size, dtype=np.float32)
    target_rain_samples = int(size * rain_percentage)
    current_rain_samples = 0

    while current_rain_samples + 180 < target_rain_samples:
        # Choose valid rain event length (multiple of 90)
        event_len = int(rng.choice(rain_event_lengths_in_samples))

        # Clip to the largest possible multiple of 90 that fits
        remaining = target_rain_samples - current_rain_samples
        if event_len > remaining:
            event_len = (remaining // 90) * 90
            if event_len < 90:
                break  # stop if too little room for even one event

        # Choose a valid start index (must be multiple of 90)
        valid_starts = np.arange(0, size - event_len + 1, 90)
        start = rng.choice(valid_starts)

        # Ensure no overlap with existing rain
        if np.any(rain_rate[start:start + event_len] > 0):
            continue

        # Generate rain values from exponential distribution
        rain_vals = rng.exponential(scale=scale, size=event_len)
        rain_vals = np.clip(rain_vals, 0, 70)  # limit max rain rate

        # Apply EMA smoothing
        ema_vals = np.copy(rain_vals)
        for t in range(1, len(ema_vals)):
            ema_vals[t] = alpha * ema_vals[t] + (1 - alpha) * ema_vals[t - 1]

        # Assign smoothed rain values to the sequence
        rain_rate[start:start + event_len] = ema_vals
        current_rain_samples += event_len

    return rain_rate
