def generate_synthetic_rain_rate(size):
    """
      Generate a synthetic rain rate time series using a pure exponential distribution
      with 100% rain probability (i.e., no dry samples at all).

      The exponential distribution is defined as:
          f(x; ) =  * exp(- * x)  for x  0

      In NumPy, the `scale` parameter is used, which is the inverse of :
          scale = 1 / 

      For example, using scale = 5 corresponds to  = 1/5 = 0.2,
      which means the average rain rate will be 5 mm/h.

      Parameters:
          size (int): Number of time steps to generate

      Returns:
          np.ndarray: Rain rate values (float32), clipped to a maximum mm/h
      """
    rng = np.random.default_rng()
    rain_rate = rng.exponential(scale=5.0, size=size).astype(np.float32)
    rain_rate = np.clip(rain_rate, 0, 70)  # optional, limit to max 50 mm/h
    return rain_rate

