def downsample_rain_rate_15min(rain_rate_10sec: np.ndarray, factor: int = 90) -> np.ndarray:
    """
    Downsample rain rate from 10-second resolution to 15-minute resolution (90 samples).
    """
    rain_rate_15min = rain_rate_10sec.reshape(-1, factor).mean(axis=1)
    return rain_rate_15min


def apply_wet_antenna_effect(link,
                             att_const_value=2.0,
                             de_in_crease_minutes=20,
                             sample_interval_sec=10):
    """
    Add wet antenna effect to the link.attenuation field.

    Parameters:
    - link: object with `rain_rate` and `attenuation` fields (both np.ndarray of same length).
    - att_const_value: float, the max additional attenuation caused by the wet antenna.
    - de_in_crease_minutes: float, time (in minutes) for full rise/fall of wet antenna effect.
    - sample_interval_sec: float, time resolution of samples in seconds.
    """
    rain = link.rain_rate
    attenuation = link.attenuation
    N = len(rain)
    step_len = int((de_in_crease_minutes * 60) / sample_interval_sec)  # Number of samples for rise/fall

    wet_antenna_add = np.zeros(N, dtype=np.float32)
    in_rain = False
    i = 0
    last_fall_end = -np.inf  # or -step_len if you prefer finite value

    while i < N:
        if rain[i] > 0 and not in_rain:
            #Start of a new rain event
            in_rain = True
            start = i

            # Find end of current rain event
            while i < N and rain[i] > 0:
                i += 1
            end = i

            rain_len = end - start

            # Calculate how much of the previous tail overlaps with the new rise
            overlap = max(0, last_fall_end - start)
            rise_len = max(step_len - overlap, 1)
            rise_len = min(rise_len, rain_len)  # Short rain = short rise

            # Step 1: Wet antenna rise (exponential)
            max_possible_db = att_const_value * ((rain_len+overlap) / step_len)
            max_possible_db = min(max_possible_db, att_const_value)

            # Get current value at the start index due to previous fall
            start_value = wet_antenna_add[start]

            # Exponential rise from start_value to max_possible_db over rise_len steps
            t = np.linspace(0, 1, rise_len)
            exp_rise = start_value + (max_possible_db - start_value) * (1 - np.exp(-5 * t)) / (1 - np.exp(-5))

            exp_rise = np.clip(exp_rise, 0, att_const_value)
            wet_antenna_add[start:start + rise_len] = exp_rise

            # Step 2: Wet antenna constant middle (if any time left)
            mid_start = start + rise_len
            mid_end = end
            if mid_start < mid_end:
                wet_antenna_add[mid_start:mid_end] = att_const_value

            # Step 3: Wet antenna fall (exponential decay after rain ends)
            decay_len = min(step_len, N - end)
            fall_len = min(decay_len, rain_len)  # Short rain = short fall
            exp_fall = max_possible_db * np.exp(-np.linspace(0, 5, fall_len))
            wet_antenna_add[end:end + fall_len] += exp_fall

            # Overlap logic: if next rain comes before full fall is over
            last_fall_end = end + fall_len  # absolute index

            in_rain = False  # Allow next rain event detection
        else:
            i += 1

    # Final attenuation update
    link.attenuation += wet_antenna_add

    return wet_antenna_add  # return for inspection or plotting

def apply_noise(link, sigma=0.5):
    """
    Apply additive white Gaussian noise (WGN) to the attenuation.

    Parameters:
    - link: SyntheticLink object with 'attenuation' field (in dB).
    - sigma: Standard deviation of the Gaussian noise.

    This function modifies link.attenuation in-place.
    """
    N = len(link.attenuation)
    rng = np.random.default_rng()

    # Generate WGN with mean 0 and std sigma
    noise = rng.normal(loc=0.0, scale=sigma, size=N)

    # Add noise to attenuation (can be positive or negative)
    link.attenuation += noise

def apply_custom_quantization(link, step=0.3):
    """
    Quantize all attenuation values to the nearest `step` (default: 0.3 dB).

    Applies uniformly across the full range (0 to max).
    Ensures attenuation remains  0.
    """
    att = link.attenuation
    quantized = np.round(att / step) * step
    link.attenuation = quantized


